import React from "react";
import PalestinianReality from "./PalestinianReality";
import ARViewer from "./ARViewer";
import "./Dashboard.css"; // CSS مخصص للصفحة

export default function Dashboard() {
  const arModel = "https://example.com/model.glb"; // رابط النموذج الثلاثي الأبعاد
  const posterImage = "https://example.com/poster.jpg"; // صورة بديلة قبل التحميل

  return (
    <main className="dashboard">
      <div className="dashboard-grid">
        <section className="dashboard-left">
          <PalestinianReality />
        </section>
        <section className="dashboard-right">
          <h2 className="section-title">النموذج الثلاثي الأبعاد</h2>
          <ARViewer modelUrl={arModel} poster={posterImage} />
        </section>
      </div>
    </main>
  );
}
